def f(n):
    def factorial(num):
        if num == 0:
            return 1
        else:
            return num * factorial(num - 1)

    output = []
    for i in range(1, n + 1):
        if i % 2 == 0:
            output.append(factorial(i))
        else:
            output.append(sum(range(1, i + 1)))

    return output

# Test the function with the example provided
print(f(5))  # Output: [1, 2, 6, 24, 15]
